import { useState } from 'react';
import './navBar.css';
export function NavBar({Route,setState}){

  const[hambug,sethambug]=useState('hambug')
    return (  
    <nav className='navbar'>
         <div onClick={()=>sethambug('hambug-view')}>
         <svg width="1em" height="1em" viewBox="0 0 48 48"><g fill="white" stroke="#000" strokeWidth="4" strokeLinecap="round" strokeLinejoin="round"><path d="M42 19H6M42 9H6M42 29H6M42 39H6"></path></g></svg>
         </div>
                
      </nav>
    )
}
